,"atom","^4","429097866666.667","^A",true],"^1G",["^ ","^3","atom","^4","528207200000","^A",true],"^1H",["^ ","^3","atom","^4","671238840106.667","^A",true],"^1I",["^ ","^3","atom","^4","735974843360","^A",true],"^1J",["^ ","^3","atom","^4","746647127413.333","^A",true],"^1K",["^ ","^3","atom","^4","756350347333.334","^A",true],"^1L",["^ ","^3","atom","^4","654269902888.715","^A",true],"^1M",["^ ","^3","atom","^4","644935541446.453","^A",true],"^1N",["^ ","^3","atom","^4","683827144288.536","^A",true],"^1O",["^ ","^3","atom"],"^1P",["^ ","^3","atom"],"^1Q",["^ ","^3","atom"],"^1R",["^ ","^3","atom"],"^1S",["^ ","^3","atom"],"^1T",["^ ","^3","atom"],"^1U",["^ ","^3","atom"],"^1V",["^ ","^3","atom"],"^1W",["^ ","^3","atom"],"^1X",["^ ","^3","atom"],"^1Y",["^ ","^3","atom"],"^1Z",["^ ","^3","atom"],"^1[",["^ ","^3","atom"]]]],"countryMeta",["^ ","IN",["^ ","adminregion",["^ ","^3","atom","^4","8S"],"en",["^ ","^3","atom","^4",["^ ","PPPsurveyyear","2011","Latestindustrialdata","2014","Latesthouseholdsurvey","Demographic and Health Survey, 2015/16","SpecialNotes","Fiscal year end: March 31; reporting period for national accounts data: FY. Based on official government statistics; the new base year is 2011/12. India reports using SNA 2008.","Nationalaccountsbaseyear","2011/12","SNApricevaluation","Value added at basic prices (VAB)","BalanceofPaymentsManualinuse","BPM6","Latestpopulationcensus","2011","2-alphacode","IN","TableName","India","LongName","Republic of India","financeName","India","SourceofmostrecentIncomeandexpendituredata","Integrated household survey (IHS), 2011/12","Latestwaterwithdrawaldata","2010","CurrencyUnit","Indian rupee","Region","South Asia","capital","New Delhi","IMFdatadisseminationstandard","Special Data Dissemination Standard (SDDS)","ExternaldebtReportingstatus","Actual","WB-2code","IN","GovernmentAccountingconcept","Consolidated central government","Systemoftrade","General trade system","^5","India","SystemofNationalAccounts","Country uses the 2008 System of National Accounts methodology","Latestagriculturalcensus","2010/11","Latesttradedata","2017","IncomeGroup","Lower middle income","Lendingcategory","IBRD","ShortName","India"]],"id",["^ ","^3","atom","^4","IND"],"incomelevel",["^ ","^3","atom","^4","XN"],"^6",["^ ","^3","atom","^4","country"],"locations",["^ ","^3","atom"],"^5",["^ ","^3","atom","^4","India"],"region",["^ ","^3","atom","^4","8S"]]],"indicatorMeta",["^ ","^:",["^ ","License_Type",["^ ","^3","atom","^4","CC BY-4.0"],"License_URL",["^ ","^3","atom","^4","https://datacatalog.worldbank.org/public-licenses#cc-by"],"WDITable",["^ ","^3","atom","^4","4.2"],"decimal",["^ ","^3","atom","^4",0],"description",["^ ","^3","atom"],"en",["^ ","^3","atom","^4",["^ ","Statisticalconceptandmethodology","Gross domestic product (GDP) represents the sum of value added by all its producers. Value added is the value of the gross output of producers less the value of intermediate goods and services consumed in production, before accounting for consumption of fixed capital in production. The United Nations System of National Accounts calls for value added to be valued at either basic prices (excluding net taxes on products) or producer prices (including net taxes on products paid by producers but excluding sales or value added taxes). Both valuations exclude transport charges that are invoiced separately by producers. Total GDP is measured at purchaser prices. Value added by industry is normally measured at basic prices.","Aggregationmethod","Gap-filled total","Periodicity","Annual","Topic","Economic Policy & Debt: National accounts: US$ at current prices: Aggregate indicators","Source","World Bank national accounts data, and OECD National Accounts data files.","Longdefinition","GDP at purchaser's prices is the sum of gross value added by all resident producers in the economy plus any product taxes and minus any subsidies not included in the value of the products. It is calculated without making deductions for depreciation of fabricated assets or for depletion and degradation of natural resources. Data are in current U.S. dollars. Dollar figures for GDP are converted from domestic currencies using single year official exchange rates. For a few countries where the official exchange rate does not reflect the rate effectively applied to actual foreign exchange transactions, an alternative conversion factor is used.","^30","https://datacatalog.worldbank.org/public-licenses#cc-by","sourceNote","GDP at purchaser's prices is the sum of gross value added by all resident producers in the economy plus any product taxes and minus any subsidies not included in the value of the products. It is calculated without making deductions for depreciation of fabricated assets or for depletion and degradation of natural resources. Data are in current U.S. dollars. Dollar figures for GDP are converted from domestic currencies using single year official exchange rates. For a few countries where the official exchange rate does not reflect the rate effectively applied to actual foreign exchange transactions, an alternative conversion factor is used.","^2[","CC BY-4.0","Limitationsandexceptions","Gross domestic product (GDP), though widely tracked, may not always be the most relevant summary of aggregated economic performance for all economies, especially when production occurs at the expense of consuming capital stock.\n\nWhile GDP estimates based on the production approach are generally more reliable than estimates compiled from the income or expenditure side, different countries use different definitions, methods, and reporting standards. World Bank staff review the quality of national accounts data and sometimes make adjustments to improve consistency with international guidelines. Nevertheless, significant discrepancies remain between international standards and actual practice. Many statistical offices, especially those in developing countries, face severe limitations in the resources, time, training, and budgets required to produce reliable and comprehensive series of national accounts statistics.\n\nAmong the difficulties faced by compilers of national accounts is the extent of unreported economic activity in the informal or secondary economy. In developing countries a large share of agricultural output is either not exchanged (because it is consumed within the household) or not exchanged for money.","fullname","GDP (current US$)","sourceOrganization","World Bank national accounts data, and OECD National Accounts data files.","shortname","GDP","IndicatorName","GDP (current US$)"]],"^3<",["^ ","^3","atom","^4","GDP (current US$)"],"id",["^ ","^3","atom","^4","NY.GDP.MKTP.CD"],"last_year",["^ ","^3","atom","^4",[2017,["TD","CR","NP","LR","MT","PW","CL","PK","GN","US","BO","HK","FM","EG","SD","T2","PL","SL","BA","KR","BE","MN","ML","BN","DZ","AL","GW","MZ","HT","CV","ET","NA","CO","GE","TH","ZA","VN","MA","ES","LT","T7","BB","CH","AT","IN","BF","GR","IS","AD","MH","RW","TN","MU","LA","QA","AU","LS","WS","T3","KZ","NR","DJ","KG","TM","GQ","GY","CA","UZ","SZ","PT","HN","HU","TG","CG","SN","ZM","LC","BR","BH","BT","TO","EE","NI","LU","FR","PE","JO","AR","FI","GD","ME","UG","NL","SO","SE","SC","SM","ZT","XK","TL","DE","GH","NO","PA","BD","LB","MW","RO","T6","CN","KW","BY","JM","SV","T5","VU","DM","MV","TT","IR","KI","AG","OM","ST","AM","MK","ID","TJ","CM","ZW","XG","CF","PS","HR","NG","MX","IL","CD","RU","GM","BG","AZ","KE","BI","MM","BJ","CI","NE","MR","SR","AO","MD","SI","NZ","TR","VC","DO","KM","AF","JP","MO","PY","KN","LY","GA","BS","UY","GB","PG","CZ","KH","IE","FJ","BZ","DK","AE","SK","LV","TV","T4","TZ","IT","IQ","UA","BW","PH","LK","MG","RS","SB","CY","GT","MY","EC","SG","SA"]]],"relatedIndicators",["^ ","^3","atom","^4",["NY.GDP.MKTP.KD.ZG","NY.GDP.MKTP.KD","NY.GDP.MKTP.KN","NY.GDP.MKTP.CN.AD","NY.GDP.MKTP.PP.KD","NY.GDP.MKTP.CN","NY.GDP.MKTP.PP.CD","NY.GDP.PCAP.KD.ZG","NY.GDP.DEFL.KD.ZG"]],"^3>",["^ ","^3","atom","^4","GDP"],"source",["^ ","^3","atom","^4","2"],"^3:",["^ ","^3","atom","^4","GDP at purchaser's prices is the sum of gross value added by all resident producers in the economy plus any product taxes and minus any subsidies not included in the value of the products. It is calculated without making deductions for depreciation of fabricated assets or for depletion and degradation of natural resources. Data are in current U.S. dollars. Dollar figures for GDP are converted from domestic currencies using single year official exchange rates. For a few countries where the official exchange rate does not reflect the rate effectively applied to actual foreign exchange transactions, an alternative conversion factor is used."],"^3=",["^ ","^3","atom","^4","World Bank national accounts data, and OECD National Accounts data files."],"sourceURL",["^ ","^3","atom"],"topics",["^ ","^3","atom","^4",[["^ ","id","3","^4","Economy & Growth","defaultLocations",["^ ","fallback",["1W"]]]]],"unit",["^ ","^3","atom","^4","dollar"]],"^20",["^ ","^2[",["^ ","^3","atom","^4","CC BY-4.0"],"^30",["^ ","^3","atom","^4","https://datacatalog.worldbank.org/public-licenses#cc-by"],"^31",["^ ","^3","atom","^4","WV.1"],"^32",["^ ","^3","atom","^4",1],"^33",["^ ","^3","atom"],"en",["^ ","^3","atom","^4",["^ ","Developmentrelevance","An economy's growth is measured by the change in the volume of its output or in the real incomes of its residents. The 2008 United Nations System of National Accounts (2008 SNA) offers three plausible indicators for calculating growth: the volume of gross domestic product (GDP), real gross domestic income, and real gross national income. The volume of GDP is the sum of value added, measured at constant prices, by households, government, and industries operating in the economy. GDP accounts for all domestic production, regardless of whether the income accrues to domestic or foreign institutions.","^34","Gross domestic product (GDP) represents the sum of value added by all its producers. Value added is the value of the gross output of producers less the value of intermediate goods and services consumed in production, before accounting for consumption of fixed capital in production. The United Nations System of National Accounts calls for value added to be valued at either basic prices (excluding net taxes on products) or producer prices (including net taxes on products paid by producers but excluding sales or value added taxes). Both valuations exclude transport charges that are invoiced separately by producers. Total GDP is measured at purchaser prices. Value added by industry is normally measured at basic prices. When value added is measured at producer prices.\n\nGrowth rates of GDP and its components are calculated using the least squares method and constant price data in the local currency. Constant price U.S. dollar series are used to calculate regional and income group growth rates. Local currency series are converted to constant U.S. dollars using an exchange rate in the common reference year.","^35","Weighted average","^36","Annual","^37","Economic Policy & Debt: National accounts: Growth rates","^38","World Bank national accounts data, and OECD National Accounts data files.","^39","Annual percentage growth rate of GDP at market prices based on constant local currency. Aggregates are based on constant 2010 U.S. dollars. GDP is the sum of gross value added by all resident producers in the economy plus any product taxes and minus any subsidies not included in the value of the products. It is calculated without making deductions for depreciation of fabricated assets or for depletion and degradation of natural resources.","^30","https://datacatalog.worldbank.org/public-licenses#cc-by","^3:","Annual percentage growth rate of GDP at market prices based on constant local currency. Aggregates are based on constant 2010 U.S. dollars. GDP is the sum of gross value added by all resident producers in the economy plus any product taxes and minus any subsidies not included in the value of the products. It is calculated without making deductions for depreciation of fabricated assets or for depletion and degradation of natural resources.","^2[","CC BY-4.0","^3;","Each industry's contribution to growth in the economy's output is measured by growth in the industry's value added. In principle, value added in constant prices can be estimated by measuring the quantity of goods and services produced in a period, valuing them at an agreed set of base year prices, and subtracting the cost of intermediate inputs, also in constant prices. This double-deflation method requires detailed information on the structure of prices of inputs and outputs.\n\nIn many industries, however, value added is extrapolated from the base year using single volume indexes of outputs or, less commonly, inputs. Particularly in the services industries, including most of government, value added in constant prices is often imputed from labor inputs, such as real wages or number of employees. In the absence of well defined measures of output, measuring the growth of services remains difficult.\n\nMoreover, technical progress can lead to improvements in production processes and in the quality of goods and services that, if not properly accounted for, can distort measures of value added and thus of growth. When inputs are used to estimate output, as for nonmarket services, unmeasured technical progress leads to underestimates of the volume of output. Similarly, unmeasured improvements in quality lead to underestimates of the value of output and value added. The result can be underestimates of growth and productivity improvement and overestimates of inflation.\n\nInformal economic activities pose a particular measurement problem, especially in developing countries, where much economic activity is unrecorded. A complete picture of the economy requires estimating household outputs produced for home use, sales in informal markets, barter exchanges, and illicit or deliberately unreported activities. The consistency and completeness of such estimates depend on the skill and methods of the compiling statisticians.\n\nRebasing of national accounts can alter the measured growth rate of an economy and lead to breaks in series that affect the consistency of data over time. When countries rebase their national accounts, they update the weights assigned to various components to better reflect current patterns of production or uses of output. The new base year should represent normal operation of the economy - it should be a year without major shocks or distortions. Some developing countries have not rebased their national accounts for many years. Using an old base year can be misleading because implicit price and volume weights become progressively less relevant and useful.\n\nTo obtain comparable series of constant price data for computing aggregates, the World Bank rescales GDP and value added by industrial origin to a common reference year. Because rescaling changes the implicit weights used in forming regional and income group aggregates, aggregate growth rates are not comparable with those from earlier editions with different base years. Rescaling may result in a discrepancy between the rescaled GDP and the sum of the rescaled components. To avoid distortions in the growth rates, the discrepancy is left unallocated. As a result, the weighted average of the growth rates of the components generally does not equal the GDP growth rate.","^3<","GDP growth (annual %)","^3=","World Bank national accounts data, and OECD National Accounts data files.","^3>","GDP growth","^3?","GDP growth (annual %)"]],"^3<",["^ ","^3","atom","^4","GDP growth (annual %)"],"id",["^ ","^3","atom","^4","NY.GDP.MKTP.KD.ZG"],"^3@",["^ ","^3","atom","^4",[2017,["TD","CR","NP","LR","MT","PW","CL","PK","GN","US","BO","HK","FM","EG","SD","T2","PL","SL","BA","KR","BE","MN","ML","BN","DZ","AL","GW","MZ","HT","CV","ET","NA","CO","GE","TH","ZA","VN","MA","ES","LT","T7","BB","CH","AT"," ,"^3","atom"],"en",["^ ","^3","atom","^4",["^ ","^3H","An economy's growth is measured by the change in the volume of its output or in the real incomes of its residents. The 2008 United Nations System of National Accounts (2008 SNA) offers three plausible indicators for calculating growth: the volume of gross domestic product (GDP), real gross domestic income, and real gross national income. The volume of GDP is the sum of value added, measured at constant prices, by households, government, and industries operating in the economy. GDP accounts for all domestic production, regardless of whether the income accrues to domestic or foreign institutions.","^34","Gross domestic product (GDP) represents the sum of value added by all its producers. Value added is the value of the gross output of producers less the value of intermediate goods and services consumed in production, before accounting for consumption of fixed capital in production. The United Nations System of National Accounts calls for value added to be valued at either basic prices (excluding net taxes on products) or producer prices (including net taxes on products paid by producers but excluding sales or value added taxes). Both valuations exclude transport charges that are invoiced separately by producers. Total GDP is measured at purchaser prices. Value added by industry is normally measured at basic prices. When value added is measured at producer prices.\n\nGrowth rates of GDP and its components are calculated using the least squares method and constant price data in the local currency. Constant price U.S. dollar series are used to calculate regional and income group growth rates. Local currency series are converted to constant U.S. dollars using an exchange rate in the common reference year.","^35","Gap-filled total","^36","Annual","BasePeriod","2010","^37","Economic Policy & Debt: National accounts: US$ at constant 2010 prices: Aggregate indicators","^38","World Bank national accounts data, and OECD National Accounts data files.","^39","GDP at purchaser's prices is the sum of gross value added by all resident producers in the economy plus any product taxes and minus any subsidies not included in the value of the products. It is calculated without making deductions for depreciation of fabricated assets or for depletion and degradation of natural resources. Data are in constant 2010 U.S. dollars. Dollar figures for GDP are converted from domestic currencies using 2010 official exchange rates. For a few countries where the official exchange rate does not reflect the rate effectively applied to actual foreign exchange transactions, an alternative conversion factor is used.","^30","https://datacatalog.worldbank.org/public-licenses#cc-by","^3:","GDP at purchaser's prices is the sum of gross value added by all resident producers in the economy plus any product taxes and minus any subsidies not included in the value of the products. It is calculated without making deductions for depreciation of fabricated assets or for depletion and degradation of natural resources. Data are in constant 2010 U.S. dollars. Dollar figures for GDP are converted from domestic currencies using 2010 official exchange rates. For a few countries where the official exchange rate does not reflect the rate effectively applied to actual foreign exchange transactions, an alternative conversion factor is used.","^2[","CC BY-4.0","^3;","Each industry's contribution to growth in the economy's output is measured by growth in the industry's value added. In principle, value added in constant prices can be estimated by measuring the quantity of goods and services produced in a period, valuing them at an agreed set of base year prices, and subtracting the cost of intermediate inputs, also in constant prices. This double-deflation method requires detailed information on the structure of prices of inputs and outputs.\n\nIn many industries, however, value added is extrapolated from the base year using single volume indexes of outputs or, less commonly, inputs. Particularly in the services industries, including most of government, value added in constant prices is often imputed from labor inputs, such as real wages or number of employees. In the absence of well defined measures of output, measuring the growth of services remains difficult.\n\nMoreover, technical progress can lead to improvements in production processes and in the quality of goods and services that, if not properly accounted for, can distort measures of value added and thus of growth. When inputs are used to estimate output, as for nonmarket services, unmeasured technical progress leads to underestimates of the volume of output. Similarly, unmeasured improvements in quality lead to underestimates of the value of output and value added. The result can be underestimates of growth and productivity improvement and overestimates of inflation.\n\nInformal economic activities pose a particular measurement problem, especially in developing countries, where much economic activity is unrecorded. A complete picture of the economy requires estimating household outputs produced for home use, sales in informal markets, barter exchanges, and illicit or deliberately unreported activities. The consistency and completeness of such estimates depend on the skill and methods of the compiling statisticians.\n\nRebasing of national accounts can alter the measured growth rate of an economy and lead to breaks in series that affect the consistency of data over time. When countries rebase their national accounts, they update the weights assigned to various components to better reflect current patterns of production or uses of output. The new base year should represent normal operation of the economy - it should be a year without major shocks or distortions. Some developing countries have not rebased their national accounts for many years. Using an old base year can be misleading because implicit price and volume weights become progressively less relevant and useful.\n\nTo obtain comparable series of constant price data for computing aggregates, the World Bank rescales GDP and value added by industrial origin to a common reference year. Because rescaling changes the implicit weights used in forming regional and income group aggregates, aggregate growth rates are not comparable with those from earlier editions with different base years. Rescaling may result in a discrepancy between the rescaled GDP and the sum of the rescaled components. To avoid distortions in the growth rates, the discrepancy is left unallocated. As a result, the weighted average of the growth rates of the components generally does not equal the GDP growth rate.","^3>","GDP","^3=","World Bank national accounts data, and OECD National Accounts data files.","^3<","GDP (constant 2010 US$)","^3?","GDP (constant 2010 US$)"]],"^3<",["^ ","^3","atom","^4","GDP (constant 2010 US$)"],"id",["^ ","^3","atom","^4","NY.GDP.MKTP.KD"],"^3@",["^ ","^3","atom","^4",[2017,["TD","CR","NP","LR","MT","PW","CL","PK","GN","US","BO","HK","FM","EG","SD","T2","PL","SL","BA","KR","BE","MN","ML","BN","DZ","AL","GW","MZ","HT","CV","ET","NA","CO","GE","TH","ZA","VN","MA","ES","LT","T7","BB","CH","AT","IN","BF","GR","IS","AD","MH","RW","TN","MU","LA","QA","AU","LS","WS","T3","KZ","NR","KG","TM","GQ","GY","CA","UZ","SZ","PT","HN","HU","TG","CG","SN","ZM","LC","BR","BH","BT","TO","EE","NI","LU","FR","PE","JO","AR","FI","GD","ME","UG","NL","SE","SC","SM","ZT","XK","TL","DE","GH","NO","PA","BD","LB","MW","RO","T6","CN","KW","BY","JM","SV","T5","VU","DM","MV","TT","IR","KI","AG","OM","ST","AM","MK","ID","TJ","CM","ZW","XG","CF","PS","HR","NG","MX","IL","CD","RU","GM","BG","AZ","KE","BI","MM","BJ","CI","NE","MR","SR","AO","MD","SI","NZ","TR","VC","DO","KM","AF","JP","MO","PY","KN","LY","GA","BS","UY","GB","PG","CZ","KH","IE","FJ","BZ","DK","AE","SK","LV","TV","T4","TZ","IT","IQ","UA","BW","PH","LK","MG","RS","SB","CY","GT","MY","EC","SG","SA"]]],"^3A",["^ ","^3","a  sum of gross value added by all resident producers in the economy plus any product taxes and minus any subsidies not included in the value of the products. It is calculated without making deductions for depreciation of fabricated assets or for depletion and degradation of natural resources. Data are in constant local currency."],"^3=",["^ ","^3","atom","^4","World Bank national accounts data, and OECD National Accounts data files."],"^3C",["^ ","^3","atom"],"^3D",["^ ","^3","atom","^4",[["^ ","id","3","^4","Economy & Growth","^3E",["^ ","^3F",["1W"]]]]],"^3G",["^ ","^3","atom","^4","unknown"]],"^23",["^ ","^2[",["^ ","^3","atom","^4","CC BY-4.0"],"^30",["^ ","^3","atom","^4","https://datacatalog.worldbank.org/public-licenses#cc-by"],"^31",["^ ","^3","atom"],"^32",["^ ","^3","atom","^4",0],"^33",["^ ","^3","atom"],"en",["^ ","^3","atom","^4",["^ ","^34","The accuracy of national accounts estimates and their comparability across countries depend on timely revisions to data on GDP and its components. The frequency of revisions to GDP data varies: some countries revise numbers monthly, others quarterly or annually, and others less frequently. Such revisions are usually small and based on additional information received during the year. However, larger revisions are required from time to time to rebase the national accounts and allow for incorporation of new methodologies and data sources.\n\nComprehensive revisions of GDP data often (but not always) result in upward adjustments to GDP and other major aggregates as improved data sources increase the coverage of the economy. And estimates of GDP growth may change as new weights are introduced. These revisions will cause breaks in series unless they are applied consistently to historical data. For constant price series a break caused by rebasing can be eliminated by linking the old series to the new using historical growth rates.\n\nThis current price GDP series has been linked to produce a consistent time series. It has been calculated by utilizing the change in the implicit GDP deflator in the WDI Archive and IMF WEO databases. Thus, earlier years (linked years) will not be comparable with other national accounts series in the database. Data are available for World Bank operational countries only.","^36","Annual","^37","Economic Policy & Debt: National accounts: Local currency at current prices: Aggregate indicators","^38","World Bank staff estimates based on World Bank national accounts data archives, OECD National Accounts, and the IMF WEO database.","^39","GDP at purchaser's prices is the sum of gross value added by all resident producers in the economy plus any product taxes and minus any subsidies not included in the value of the products. It is calculated without making deductions for depreciation of fabricated assets or for depletion and degradation of natural resources. This series has been linked to produce a consistent time series to counteract breaks in series over time due to changes in base years, source data and methodologies. Thus, it may not be comparable with other national accounts series in the database for historical years. Data are in current local currency.","^30","https://datacatalog.worldbank.org/public-licenses#cc-by","^3:","GDP at purchaser's prices is the sum of gross value added by all resident producers in the economy plus any product taxes and minus any subsidies not included in the value of the products. It is calculated without making deductions for depreciation of fabricated assets or for depletion and degradation of natural resources. This series has been linked to produce a consistent time series to counteract breaks in series over time due to changes in base years, source data and methodologies. Thus, it may not be comparable with other national accounts series in the database for historical years. Data are in current local currency.","^2[","CC BY-4.0","^3<","GDP: linked series (current LCU)","^3=","World Bank staff estimates based on World Bank sum of gross value added by all resident producers in the economy plus any product taxes and minus any subsidies not included in the value of the products. It is calculated without making deductions for depreciation of fabricated assets or for depletion and degradation of natural resources. Data are in current international dollars. For most economies PPP figures are extrapolated from the 2011 International Comparison Program (ICP) benchmark estimates or imputed using a statistical model based on the 2011 ICP. For 47 high- and upper middle-income economies conversion factors are provided by Eurostat and the Organisation for Economic Co-operation and Development (OECD).","^30","https://datacatalog.worldbank.org/public-licenses#cc-by","^3:","PPP GDP is gross domestic product converted to international dollars using purchasing power parity rates. An international dollar has the same purchasing power over GDP as the U.S. dollar has in the United States. GDP is the sum of gross value added by all resident producers in the economy plus any product taxes and minus any subsidies not included in the value of the products. It is calculated without making deductions for depreciation of fabricated assets or for depletion and degradation of natural resources. Data are in current international dollars. For most economies PPP figures are extrapolated from the 2011 International Comparison Program (ICP) benchmark estimates or imputed using a statistical model based on the 2011 ICP. For 47 high- and upper middle-income economies conversion factors are provided by Eurostat and the Organisation for Economic Co-operation and Development (OECD).","^2[","CC BY-4.0","^3<","GDP, PPP (current international $)","^3=","World Bank, International Comparison Program database.","^3>","GDP, PPP","^3?","GDP, PPP (current international $)"]],"^3<",["^ ","^3","atom","^4","GDP, PPP (current international $)"],"id",["^ ","^3","atom","^4","NY.GDP.MKTP.PP.CD"],"^3@",["^ ","^3","atom","^4",[2017,["TD","CR
